-- ----------------------------
-- Table structure for SYS_SMS
-- ----------------------------
DROP TABLE "JEECGBOOT"."SYS_SMS";
CREATE TABLE "JEECGBOOT"."SYS_SMS" (
  "ID" NVARCHAR2(32) NOT NULL ,
  "ES_TITLE" NVARCHAR2(100) ,
  "ES_TYPE" NVARCHAR2(1) ,
  "ES_RECEIVER" NVARCHAR2(50) ,
  "ES_PARAM" NVARCHAR2(1000) ,
  "ES_CONTENT" NCLOB ,
  "ES_SEND_TIME" DATE ,
  "ES_SEND_STATUS" NVARCHAR2(1) ,
  "ES_SEND_NUM" NUMBER(11) ,
  "ES_RESULT" NVARCHAR2(255) ,
  "REMARK" NVARCHAR2(500) ,
  "CREATE_BY" NVARCHAR2(32) ,
  "CREATE_TIME" DATE ,
  "UPDATE_BY" NVARCHAR2(32) ,
  "UPDATE_TIME" DATE 
)
TABLESPACE "USERS"
LOGGING
NOCOMPRESS
PCTFREE 10
INITRANS 1
STORAGE (
  INITIAL 65536 
  NEXT 1048576 
  MINEXTENTS 1
  MAXEXTENTS 2147483645
  BUFFER_POOL DEFAULT
)
PARALLEL 1
NOCACHE
DISABLE ROW MOVEMENT
;
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ID" IS 'ID';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_TITLE" IS '消息标题';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_TYPE" IS '发送方式：1短信 2邮件 3微信';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_RECEIVER" IS '接收人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_PARAM" IS '发送所需参数Json格式';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_CONTENT" IS '推送内容';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_SEND_TIME" IS '推送时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_SEND_STATUS" IS '推送状态 0未推送 1推送成功 2推送失败 -1失败不再发送';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_SEND_NUM" IS '发送次数 超过5次不再发送';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."ES_RESULT" IS '推送失败原因';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."REMARK" IS '备注';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."CREATE_BY" IS '创建人登录名称';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."CREATE_TIME" IS '创建日期';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."UPDATE_BY" IS '更新人登录名称';
COMMENT ON COLUMN "JEECGBOOT"."SYS_SMS"."UPDATE_TIME" IS '更新日期';

